            left: 50%;
            transform: translate(-50%, -50%);
            width: 100%;
            height: 2px;
            background-color: #333;
            opacity: 0;
            transition: opacity 0.2s;
        }

        .custom-checkbox::after {
            content: '';
            display: block;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 100%;
            height: 2px;
            background-color: #333;
            opacity: 0;
            transition: opacity 0.2s;
        }

        .custom-checkbox::before {
            transform: translate(-50%, -50%) rotate(45deg);
        }

        .custom-checkbox::after {
            transform: translate(-50%, -50%) rotate(-45deg);
        }

        .custom-checkbox.checked::before {
            display: block;
